  false,\n\t\"url\": null,\n\t\"notes\": \"The Conductivity, Temperature and Depth
  (CTD); and other data were collected using NOAA Ship Oceanographer from TOGA Area-Pacific
  (30 N to 30 S) under the Transport of Equatorial Waters, research project. The data
  was collected over a two month period spanning from May 19 to July 27, 1987 by Pacific
  Marine Environmental Laboratory, Seattle, WA. Data was submitted by Dr. Stanley
  P. Hayes in two tapes. The data has been processed by NODC and is currently available
  in F022-CTD Hi resolution file format.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
